import Link from 'next/link'
import Layout from '../components/Layout'
import React from 'react';


class IndexPage extends React.Component<{}, { isBoxVisible: boolean }> {
 
  constructor(props: Readonly<{}>){
    super(props);
    this.state = {
      isBoxVisible:false
    };
  }

  toggleBox = () => {
    this.setState( {isBoxVisible:!this.state.isBoxVisible});
  };

  render() {
    const { isBoxVisible } = this.state;
    console.log(this.state);
    return (
     

      <Layout title="Home | Next.js + TypeScript Example">

<nav className="navbar navbar-expand bg-dark navbar-dark">
  <a className="navbar-brand" href="#">Navbar</a>
  <button className="navbar-toggler indexcity" onClick={this.toggleBox} type="button">
    TOGGLE
    {/* <span className="navbar-toggler-icon"></span> */}
  </button>
  <div className={this.state.isBoxVisible ? "navbar-collapse right":"navbar-collapse"} id="collapsibleNavbar">
    <ul className="nav navbar-nav navbar-right">
      <li className="nav-item">
        <a className="nav-link" href="#">Link</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">Link</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">Link</a>
      </li>    
    </ul>
  </div>  
</nav>


    <h1>Hello Next.js ðŸ‘‹</h1>
    <p>
      <Link href="/about">
        <a>About</a>
      </Link>
    </p>
    {this.state.isBoxVisible ?
          <button className="test mr-2 btn-primary btn">Primary</button> :
           null
        }
    

  </Layout>
    )
  }
}

export default IndexPage
